  input: TEXT,F3XA,,"Amendment addresses FEC letter dated February 13, 2007.  Each
    of the three bullet points are addressed, in their own order.  The Democratic
    Party of SC utilizes the most current version available of FECfile.  Totals for
    the various lines are automatically calculated and are without manual intervention.
